import React from 'react';
import 'antd/dist/antd.css';

import { Input } from 'antd';

const { Search } = Input;

function Searchbar() {
  return (
    <React.Fragment>
      <Search
        placeholder="input search text"
        enterButton="Search"
        size="large"
        onSearch={(value) => console.log(value)}
      />
    </React.Fragment>
  );
}

export default Searchbar;
